import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";

import Profile from "./screens/Profile";
import Market from "./screens/Market";

import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";

const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRout="Profile">
        <Stack.Screen
          name="Profile" // Name for the page, used to reference it when navigating.
          component={Profile} // Which Component should be rendered when the page is shown?
          options={{
            title: "Data eState",
            headerShown: true,
          }}
          // This defines the Title shown in the top-bar
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
